VALUES (2247, 0, 1, 1, 'Thank you', '', '', '', '', '', '<font size=\"2\">Dear {fName} {lName}</font><br><div style=\"font-size: 12px;\"><font size=\"6\"><br></font></div><div style=\"font-size: 12px;\"><font size=\"6\">Thank you!<br></font><br><br><font size=\"3\">Your questionnaire has been received. You will hear from us shortly.</font></div>', 'N', '2013-12-11 00:00:00', '2013-12-11 00:00:00'),
       (2248, 0, 1, 1, 'Negative Response', 'Immigration to Canada', '', '', '', '', 'Dear {fName} {lName},<br><br>Thank you for submitting your preliminary questionnaire.<br><br>We reviewed your questionnaire, and unfortunately you are not qualified to apply for immigration to Australia at this time based on the information you have provided us. <br><br>The assessment criteria to determine eligibility to immigrate to Australia are complex and change from time to time. Your inadmissibility now does not mean that you will be inadmissible in the future. We encourage you to contact us again in the future for a reassessment of your circumstances.<br><br>If you have any questions, or need to further assistance, please do not hesitate to contact us.<br><br>Regards,<br><br>{company}<br><br>', 'N', '2013-12-11 00:00:00', '2013-12-11 00:00:00'),
       (2249, 0, 1, 1, 'Need More Information', 'RE: Need Further Information', '', '', '', '', 'Dear {fName} {lName}<div><br></div><div>Thank you for submitting the preliminary questionnaire. In order for us to assess your enquiry further, please provide us the following information:</div><div><br></div><div><font color=\"#ff0000\">&lt;Agent Lists further information required&gt;</font></div><div><font color=\"#ff0000\"><br></font></div><div>Please do not hesitate to contact us if you have any further questions.</div><div><br></div><div>Thank You,</div><div><br></div><div>{company}</div>', 'N', '2014-05-27 00:00:00', '2014-05-27 00:00:00'),
       (2250, 0, 1, 1, 'Positive Response', 'RE: You Qualify to apply for an Australian Visa', '', '', '', '', 'Dear {fName} {lName},<div><br></div><div>Thank you for completing our preliminary questionnaire.</div><div><br></div><div>According to the information you have provided us, we are pleased to inform you that you qualify to apply for [subclass] visa.</div><div><br></div><div>We would be more than happy to assist you in this matter. Please find attached our Client Service Agreement. If you are happy with the terms, please sign and return this to us at your earliest so that we can start assisting you.</div><div><br></div><div>one of our friendly staff will contact you soon on [phone number.]&nbsp;</div><div><br></div><div>Thank you,</div><div><br></div><div>{company}</div>', 'N', '2014-05-27 00:00:00', '2014-05-27 00:00:00');
