pan=\"3\" align=\"left\" width=\"85%\"><br></td>\n<td align=\"right\" width=\"15%\">${invoice: gst/hst fee}</td></tr>\n<tr>\n<td colspan=\"4\" width=\"100%\"><br></td></tr>\n<tr>\n<td colspan=\"3\" align=\"right\" width=\"85%\"><b>TOTAL</b></td>\n<td align=\"right\" width=\"15%\"><b>${invoice: total}</b></td></tr></tbody></table><br>\n<div>\n<center><b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b></center></div>',
        '2010-07-14'),
       (3, 'system', 'Reply to Request a Demo', 'Officio request for demo', 'support@officio.com.au', '{prospects: email}', 'support@officio.com.au', 'bateni@officio.com.au',
        '<p><font size=\"2\" style=\"font-family: arial; font-size: 12px;\">Dear {prospects: salutation} {prospects: last name};<br><br>Thank you for your interest in Officio, the ultimate in Migration Practice Management software.<br><br></font><font size=\"2\"><font face=\"arial\"><span style=\"font-size: 12px;\">To learn more about Officio, please&nbsp;</span>suggest<span style=\"font-size: 12px;\">&nbsp;a suitable time when we can arrange for an online demo.</span></font></font></p><p style=\"font-family: arial; font-size: 12px;\"><span style=\"font-size: small;\">If we can be of any further assistance, please do not hesitate to contact us.<br></span><span style=\"font-size: small;\"><br>Best regards,<br></span><span style=\"font-size: small;\">Officio Team</span></p>\n<p><font size=\"2\"><font face=\"arial\">_______________________________________ </font><br><br><font face=\"arial\">Officio Australia</font><br><font face=\"arial\">T:+61 7 3040 8008&nbsp;</font><br><font face=\"arial\"><span style=\"font-size: 12px;\">Level 7, 199 George Street, Brisbane, QLD, 4000</span></font><br><font face=\"arial\"><span style=\"font-size: 12px;\"><a href=\"http://www.officio.com.au\">www.officio.com.au</a><a href=\"http://www.uniques.ca\" rel=\"nofollow\" target=\"_blank\"></a></span></font></font></p>',
        '2011-04-15'),
       (4, 'system', 'Support Email', 'Officio Support {support email counter}', '{support request: email}', 'support@officio.com.au', '', 'bateni@officio.com.au', '<font face=\"arial\">Dear {support request: name},<br><br>Thank you for your inquiry.<br><br><br><br><br>If we can be of further assistance, please do not hesitate to contact us.<br><br>Best regards,<br>Officio Support Team<br><br>----------------------------------------------------------------------------------<br><br>Name: {support request: name}<br>Company: {support request: company}<br>Tel: {support request: phone}<br>Email: {support request: email}<br>Your Request:<br><br>{support request: request}</font><br>', '2010-05-26'),
       (5, 'system', 'Signup Completed', 'Welcome to Officio. Your online office.', 'support@officio.com.au', '{prospects: email}', 'support@officio.com.au', 'bateni@officio.com.au',
        '<p><font face=\"arial\" size=\"2\">Dear {prospects: salutation} {prospects: last name};<br><br>Thank you for signing up with Officio, the ultimate in migration practice management software.<br><br>Before using Officio, you need to setup your account. If you have not already set up your account, please click on the following link:<a style=\"font-family: arial; font-size: 12px;\"><br><br>http://secure.officio.com.au/companywizard</a><a href=\"http://secure.officio.com.au/companywizard?key=%7Bprospects:%20reg.%20key%7D\" style=\"font-family: arial; font-size: 12px;\">?key={prospects: reg. key}</a><br><br><span style=\"font-size: 12px;\">This link takes you thru a simple step-by-step wizard to customize the software to your requirements. Once the setup is complete, you can start using Officio immediately.</span><br><br><span style=\"font-size: 12px;\">If we can be of any further assistance, please do not hesitate to contact us by replying to this email.</span><br><br><span style=\"font-size: 12px;\">Regards,</span><br><span style=\"font-size: 12px;\">Officio Support Team</span><br><span style=\"font-size: 12px;\">---------------------------------------------------</span><br><span style=\"font-size: 12px;\">Officio Pty Ltd.</span><br><span style=\"font-size: 12px;\">T:&nbsp;</span>+61 7 3040 8008<span style=\"font-size: 12px;\">&nbsp;</span><br><span style=\"font-size: 12px;\">Level 7, 199 George Street, Brisbane, QLD, 4000</span><br><span style=\"font-size: 12px;\">www.officio.com.au</span></font><br></p>',
        '2011-04-15'),
       (7, 'other', 'follow up 1', 'follow up to your last demo request', 'support@officio.com.au', '{prospects: email}', '', '', 'Dear {prospects: name} {prospects: last name}вЂ‹;<br><br>I hope you have had a chance to review our demo video.&nbsp;&nbsp; If you have any questions or require more information about a specific requirement you have, please reply to this email with your questions.<br><br>Regards<br>Officio Sales Team<br>', '2009-12-27'),
       (8, 'system', 'New user notification on Company Creation', 'Your Officio account information', 'support@officio.com.au', '{user: email}', '', 'support@officio.com.au',
        '<font face=\"arial\" size=\"2\">Dear {user: first name},</font>\n<div><font face=\"arial\" size=\"2\"><br>Welcome to Officio.com.au, the ultimate in Migration Practice Management software.<br><br>1. You have been added to Officio by your company Admin.&nbsp;You can login to Officio by clicking on the following link:</font></div>\n<div><font face=\"arial\" size=\"2\"><br><a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a> <br><br></font></div>\n\n<div><div><font face=\"arial\" size=\"2\">The followings are your login details:</font></div>\n<div><font face=\"arial\" size=\"2\"><br></font></div>\n<div><font face=\"arial\" size=\"2\">Username:&nbsp; <b>{user: username}</b></font><font face=\"arial\" size=\"2\"><br>Password: &nbsp; &nbsp;<b>{user: password}</b></font><font face=\"arial\" size=\"2\"><br><br></font>\n<div><font face=\"arial\" size=\"2\">For the security of your data, please ensure to always log out from Officio when you finish work.<br><br>2. To learn more about Officio, please ensure to visit the help, where you can access tutorials for various sections of the program. This helps you get familiar with the program more quickly. Please ensure to configure your email and calendar to start using these components as well.<br><br></font><font face=\"arial\" size=\"2\"><br><br>We hope you enjoy your experience with Officio.</font><font face=\"arial\" size=\"2\"> If we can do anything to enhance your experience with Officio, please do not hesitate to let us know.<br><br>Regards,</font><font face=\"arial\" size=\"2\"><br>Officio Support Team</font></div></div>\n<div><font face=\"arial\"><br></font></div>\n<div><font face=\"arial\"><br></font></div></div>',
        '2011-04-15'),
       (9, 'system', 'Forgotten Email', 'Your login details to Officio', 'support@officio.com.au', '{user: email}', '', '',
        '<div><font face=\"arial\"><span style=\"FONT-SIZE: small\">Dear {user: first name} {user: last name};</span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\"><br></span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\">As per your request, please find below your login details:</span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\"><br></span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\">User ID: <b>{user: username}</b></span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\">Link to reset password: <b><a href=\"https://secure.officio.com.au/auth/recovery/hash/{user: password hash}\">click here</a></b></span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\"><br></span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\">For the security of your data, please ensure to always logout from Officio when you finish work.</span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\"><br></span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\">Regards,</span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\">Officio Support Team</span></font></div>\n<div><font face=\"arial\"><span style=\"FONT-SIZE: small\"><br></span></font></div><br>',
        '2011-04-15'),
       (10, 'system', 'Special CC Charge', '{special cc charge: notes}', '', '', '', '',
