br></td>\n<td align=\"right\" width=\"15%\"><b>${invoice: subtotal}</b></td></tr>\n<tr>\n<td colspan=\"4\" width=\"100%\"><br></td></tr>\n<tr>\n<td colspan=\"3\" align=\"left\" width=\"85%\">GST<br></td>\n<td align=\"right\" width=\"15%\">${invoice: gst/hst fee}</td></tr>\n<tr>\n<td colspan=\"4\" width=\"100%\"><br></td></tr>\n<tr>\n<td colspan=\"3\" align=\"right\" width=\"85%\"><b>TOTAL</b></td>\n<td align=\"right\" width=\"15%\">${special cc charge: amount}</td></tr></tbody></table><br>\n<p></p>\n<center><b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b></center>\n<p></p>',
        '2010-07-14'),
       (11, 'system', 'Credit Card Processing Error', 'Officio Billing - Please update your credit card information', 'support@officio.com.au', 'support@officio.com.au', '', 'shahram@officio.com.au',
        '<font face=\"arial\" size=\"2\">Dear </font><font face=\"arial\" size=\"2\">{admin first name} {admin last name};<br><br>Our automated billing system has encountered the following error in processing your credit card:<br></font><font size=\"2\"><font face=\"arial\"><br><b>{error message}</b></font><br></font><font face=\"arial\" size=\"2\"><br>To update your credit card details, please take the following steps:<br><br>- Login to Officio, <br>- On the top-right corner of the screen, click on <b>Admin</b><br>- On the left, click on <b>Company Details</b><br>- Click on <b>Account Details</b><br>- Click on <b>Update Credit Card on File</b><br>- Update your credit card information and click on Save<br><br>We will be automatically notified of this change, and your account will be reinstated automatically.<br><br>If we can be of any further assistance, please do not hesitate to contact us by replying to this email.<br><br>Best regards,<br>Officio Billing Team<br></font><font size=\"2\"><span style=\"FONT-FAMILY: arial\"><br>_______________________________________ </span><br style=\"FONT-FAMILY: arial\"><br style=\"FONT-FAMILY: arial\">Officio Pty Ltd.<br>T: +61 7 3212-2266 F: +61 7 3212-2211<br>Level 7, 199 George Street, Brisbane, QLD, 4000<br>www.officio.com.au</font><br><br>',
        '2010-05-28'),
       (12, 'system', 'Credit card on file was updated by admin', 'Admin of {company name}вЂ‹ updated their credit card on file', 'support@officio.com.au', 'Support@officio.com.au', '', 'shahram@officio.com.au', '<br>The following company has updated their credit card information on file.&nbsp;&nbsp; Please check their account and process any invoice that is outstanding.<br><br>Their detail:<br>Company Name: {company name}<br>Company City: {company city}<br>Company Phone 1: {company phone 1}<br>Company Phone 2: {company phone 2}<br>Admin:{admin first name} {admin last name}<br>Admin email: {admin email}', '2010-05-28'),
       (13, 'system', 'Notes or Special Invoice', '{special cc charge: notes}', '', '', '', '',
        '<br>\n<table border=\"1\" cellpadding=\"5\" cellspacing=\"0\" height=\"157\" width=\"260\">\n<tbody>\n<tr>\n<td>BILL TO</td></tr>\n<tr>\n<td>{admin first name} {admin last name}<br>{company name}<br>{company address}<br>{company city} {company province/state} {company postal code/zip}<br>{company country}</td></tr></tbody></table><br><br><br>\n<table style=\"width: 70%;\" align=\"right\" border=\"1\" cellpadding=\"5\" cellspacing=\"0\">\n<tbody>\n<tr>\n<td align=\"center\">INVOICE NO.</td>\n<td align=\"center\">DATE</td>\n<td align=\"center\">TERMS</td></tr>\n<tr>\n<td align=\"left\">{invoice: number}</td>\n<td align=\"center\">{invoice: date}</td>\n<td><br></td></tr></tbody></table><br><br><br>\n<table style=\"width: 100%;\" border=\"1\" cellpadding=\"5\" cellspacing=\"0\">\n<tbody>\n<tr>\n<td align=\"center\" width=\"50%\">DESCRIPTION</td>\n<td align=\"center\" width=\"20%\">RATE</td>\n<td align=\"center\" width=\"15%\">QTY</td>\n<td align=\"center\" width=\"15%\">AMOUNT</td></tr>\n<tr>\n<td width=\"50%\">{subscription description}<br></td>\n<td align=\"center\" width=\"20%\"><br></td>\n<td align=\"center\" width=\"15%\"><br></td>\n<td align=\"right\" width=\"15%\">$ {invoice: subscription fee}</td></tr>\n<tr>\n<td width=\"50%\">Additional Users</td>\n<td align=\"center\" width=\"20%\">${invoice: price per user}/user</td>\n<td align=\"center\" width=\"15%\">{invoice: additional users}</td>\n<td align=\"right\" width=\"15%\">${invoice: additional users fee}</td></tr>\n<tr>\n<td width=\"50%\">Additional Storage</td>\n<td align=\"center\" width=\"20%\">${invoice: price per storage}/ 1Gb</td>\n<td align=\"center\" width=\"15%\">{invoice: additional storage}</td>\n<td align=\"right\" width=\"15%\">${invoice: additional storage charges}</td></tr>\n<tr>\n<td colspan=\"3\" width=\"85%\"><br></td>\n<td align=\"right\" width=\"15%\"><b>${invoice: subtotal}</b></td></tr>\n<tr>\n<td colspan=\"4\" width=\"100%\"><br></td></tr>\n<tr>\n<td colspan=\"3\" align=\"left\" width=\"85%\">GST ()</td>\n<td align=\"right\" width=\"15%\">${invoice: gst/hst fee}</td></tr>\n<tr>\n<td colspan=\"4\" width=\"100%\"><br></td></tr>\n<tr>\n<td colspan=\"3\" align=\"right\" width=\"85%\"><b>TOTAL</b></td>\n<td align=\"right\" width=\"15%\"><strong>${special cc charge: amount}</strong></td></tr></tbody></table><br>\n<div>\n<center><b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b></center></div>\n<p></p>',
