       (18, 'mass_email', 'Scheduled Maintenance', 'Scheduled Maintenance', 'Officio Support \"support@uniques.ca\"', '', '', '',
        '<font face=\"arial\"><br>Dear {user: first name},<br><br>We will be conducting a scheduled maintenance on one of Officio\'s servers on Saturday, Feb. 2nd, 2013, starting at 00:05AM AST. D</font><font face=\"arial\"><font face=\"arial\">uring this time service will not be available to you.<br></font><br>While our intent is to minimize the downtime, the server should be back online by 9:00AM AST on Saturday.&nbsp; <br><br>Officio is growing very quickly, thanks to users like you.&nbsp; This scheduled maintenance is part one of a 2-step process to expand our servers capacities.<br><br>Apart from working on infrastructure, we will be releasing a new upgrade that includes:<br>- Improved and faster performing Document-Management<br>- Time-Management Module<br>- Task-Management Module<br><br>We will be sending you additional emails with instructions on how to use these new features.<br><br>We apologize for any inconvenience this may cause. I trust you will like the new improvements.<br><br>If we can be of any further assistance, please do not hesitate to contact us.<br><br>do not hesitate to contact us.<br><br></font><font size=\"2\">Best regards,<br>Officio Team<br></font>\n<p style=\"font-family: arial;\"><font size=\"2\">_______________________________________ <br><br>Officio Pty Ltd.<br>T: +61 7 3212-2266 F: +61 7 3212-2211<br>Level 7, 199 George Street, Brisbane, QLD, 4000<br>www.officio.com.au</font></p><p><font face=\"arial\"><br></font></p><font face=\"arial\"><br><br></font>',
        '2011-11-17'),
       (19, 'mass_email', 'Officio Update 2013', 'Officio Update 2013', 'support@officio.com.au', '', '', 'shahram@officio.com.au',
        '<p></p><p><font color=\"#000000\"><font face=\"arial\"><br>Dear {user: first name},<br><br>I\'m excited to announce the release of Officio-2013. This version includes the following key features:<br><br>- Immigration News section<br>- Time Management<br></font></font><span style=\"font-family: arial;\">- Task Management<br></span><span style=\"font-family: arial;\">- Improved Document Management<br></span><span style=\"font-family: arial;\"><br>To learn more, please watch the following 10-minute video:<br></span><span style=\"font-family: arial;\"></span></p><p><span style=\"font-family: arial;\">&lt;link&gt;</span></p><p><span style=\"font-family: arial;\"></span><span style=\"font-family: arial;\"><br>These features are available to you at no extra cost. I hope you\'ll find them useful in your day-to-day operation.</span><span style=\"font-family: arial;\"><br><br>If we can be of any further assistance, please do not hesitate to contact us.<br></span><span style=\"font-family: arial;\"><br>Best regards,<br></span><span style=\"font-family: arial;\">Officio Team<br></span></p><p><font color=\"#000000\"><font face=\"arial\">_______________________________________<br><br>Officio Pty Ltd.<br>T: +61 7 3212-2266&nbsp;&nbsp;&nbsp; F: +61 7 3212-2211<br>Level 7, 199 George Street, Brisbane, QLD, 4000<br>www.officio.com.au</font></font></p><p></p>',
        '2013-02-04'),
       (21, 'mass_email', 'Scheduled Maintenance 2', 'Scheduled Maintenance', 'Officio Support \"support@officio.com.au\"', '', '', '',
        '<font face=\"arial\"><br>Dear {user: first name},<br><br>We will be performing a software upgrade on one of Officio\'s servers on Saturday, April 6th, 2013, starting at 01:00AM AST. D</font><font face=\"arial\"><font face=\"arial\">uring this time service will not be available to you.<br></font><br>While our intent is to minimize the downtime, the server should be back online by 9:00AM AST on Saturday. <br><br>We apologize for any inconvenience this may cause. I trust you will like the new improvements.<br><br></font><font face=\"arial\"><font face=\"arial\">Officio is growing very quickly, thanks to users like you. </font>If you have any suggestions or improving ideas, please do not hesitate to contact us.<br><br>Best regards, <br>Officio Team<br>_______________________________________  <br><br>Officio Pty Ltd.<br>T: +61 7 3212-2266&nbsp;&nbsp;&nbsp; F: +61 7 3212-2211<br>Level 7, 199 George Street, Brisbane, QLD, 4000<br>www.officio.com.au<a href=\"http://www.officio.ca\"></a></font><p><font face=\"arial\"><br></font></p><font face=\"arial\"><br><br></font>',
        '2013-04-04'),
