       (24, 'system', 'Certificate of Naturalisation (for PDF generation)', 'Certificate of Naturalisation (for PDF generation)', '', '', '', '',
        '<table border=\"0\" cellpadding=\"3\" align=\"left\" width=\"100%\">\n         <tr>\n          <td width=\"75%\" style=\"font-weight: bold; font-family: Cambria, Arial, Helvetica;\">COMMONWEALTH OF DOMINICA CITIZENSHIP ACT (Ch.1:10)</td>\n          <td width=\"25%\" align=\"right\" style=\"font-weight: bold; font-family: Cambria, Arial, Helvetica;\">SECTION 8</td>\n         </tr>\n        </table>\n        <p align=\"center\" style=\"font-size: 19pt;\">CERTIFICATE OF NATURALISATION</p>\n        <p style=\"text-indent: 30px; text-align: justify; font-size: 11pt;\">WHEREAS <i><b>{main_applicant_name}</b></i> has applied to the Minister responsible for citizenship in the Government of Dominica for a certificate of naturalisation, alleging with respect to {self_name} the particulars set out below, and has satisfied the Minister that the conditions laid down in the Constitution and in the Citizenship Act Chapter 1:10 for the grant of a certificate of naturalisation are fulfilled:</p>\n        <p style=\"text-indent: 30px; text-align: justify; font-size: 11pt;\">Now, THEREFORE, the Minister, in exercise of the powers conferred upon him by the said Constitution and Act, grants to the said <i><b>{main_applicant_name_2}</b></i> this Certificate of Naturalisation, and declares that upon taking the oath or affirmation of allegiance in the manner required by the Act shall be a citizen of Dominica as from the date of this certificate.</p>\n        <p style=\"text-indent: 30px; text-align: right; font-size: 11pt;\">In witness whereof I have hereto subscribed my name this ____ day of _________, _____.</p>\n        <p></p>\n        <p></p>\n        <p></p>\n        <table border=\"0\" cellpadding=\"3\" align=\"left\" width=\"100%\">\n         <tr>\n          <td width=\"65%\"></td>                                                        \n          <td width=\"35%\" style=\"font-size: 9pt; font-style: italic; text-align: center;\">………………………………………………………………<br />MINISTER FOR NATIONAL SECURITY</td>\n         </tr>\n        </table>\n        <p></p>\n        <p align=\"center\" style=\"font-weight: bold; font-size: 10pt; font-family: Times New Roman, Georgia, Serif;\">Particulars relating to applicant</p>\n        <table border=\"0\" cellpadding=\"0\" align=\"left\" width=\"100%\" style=\"font-size: 10pt; font-family: Times New Roman, Georgia, Serif;\">\n         <tr>\n          <td width=\"32%\"></td>\n          <td width=\"25%\">FULL NAME:</td>\n          <td width=\"43%\"><b><u><i>{main_applicant_name_3}</i></u></b></td>\n         </tr>\n         <tr><td colspan=\"3\"></td></tr>\n         <tr>\n          <td width=\"32%\"></td>\n          <td width=\"25%\">ADDRESS:</td>\n          <td width=\"43%\"><b><u><i>{address}</i></u></b></td>\n         </tr>\n         <tr><td colspan=\"3\"></td></tr>\n         <tr>\n          <td width=\"32%\"></td>\n          <td width=\"25%\">PROFESSION/<br />OCCUPATION:</td>\n          <td width=\"43%\"><b><u><i>{occupation}</i></u></b></td>\n         </tr>\n         <tr><td colspan=\"3\"></td></tr>\n         <tr>\n          <td width=\"32%\"></td>\n          <td width=\"25%\">PLACE OF BIRTH:</td>\n          <td width=\"43%\"><b><u><i>{place_of_birth}</i></u></b></td>\n         </tr>\n         <tr><td colspan=\"3\"></td></tr>\n         <tr>\n          <td width=\"32%\"></td>\n          <td width=\"25%\">DATE OF BIRTH:</td>\n          <td width=\"43%\"><b><u><i>{date_of_birth}</i></u></b></td>\n         </tr>\n         <tr><td colspan=\"3\"></td></tr>\n         <tr>\n          <td width=\"32%\"></td>\n          <td width=\"25%\">SINGLE/MARRIED, etc.:</td>\n          <td width=\"43%\"><b><u><i>{marital_status}</i></u></b></td>\n         </tr>\n         <tr><td colspan=\"3\"></td></tr>\n         <tr>\n          <td width=\"32%\"></td>\n          <td width=\"25%\">NAME OF SPOUSE:</td>\n          <td width=\"43%\"><b><u><i>{name_of_spouse}</i></u></b></td>\n         </tr>\n        </table>',
