       (26, 'system', 'Certificate of Naturalisation (for HTML preview)', 'Certificate of Naturalisation (for HTML preview)', NULL, NULL, NULL, NULL,
        '<div style=\"font-size: 17px; border: 1px solid #ccc; padding: 10px 10px 40px 10px; margin: 5px 5px 30px 5px; background-color: white;\">\n            <div style=\"float: right; margin: 10px 0;\">\n                <input type=\"text\" readonly disabled name=\"con_number_{page_number}\" size=\"30\" value=\"{con_number}\" style=\"text-align: right\" />\n                <input type=\"hidden\" name=\"dependent_id_{page_number}\" value=\"{dependent_id}\" />\n            </div>\n            <table border=\"0\" cellpadding=\"3\" width=\"100%\">\n                <tr>\n                    <td width=\"75%\" style=\"font-weight: bold;\">COMMONWEALTH OF DOMINICA CITIZENSHIP ACT (Ch.1:10)</td>\n                    <td width=\"25%\" align=\"right\" style=\"font-weight: bold;\">SECTION 8</td>\n                </tr>\n            </table>\n            <h1 align=\"center\" style=\"font-size: 22px; margin: 20px\">CERTIFICATE OF NATURALISATION</h1>\n            <p style=\"text-indent: 30px; padding-bottom: 15px; text-align: justify;\">\n                WHEREAS <i><b><input type=\"text\" name=\"main_applicant_name_{page_number}\" size=\"30\" value=\"{main_applicant_name}\"/></b></i> has applied to the Minister responsible for citizenship in the Government of Dominica for a certificate of naturalisation, alleging with respect to <input type=\"text\" name=\"self_name_{page_number}\" size=\"30\" value=\"{self_name}\"/> the particulars set out below, and has satisfied the Minister that\n                the conditions laid down in the Constitution and in the Citizenship Act Chapter 1:10 for the grant of a certificate of naturalisation are fulfilled:\n            </p>\n            <p style=\"text-indent: 30px; padding-bottom: 15px; text-align: justify;\">\n                Now, THEREFORE, the Minister, in exercise of the powers conferred upon him by the said Constitution and Act, grants to the said <i><b><input type=\"text\" name=\"main_applicant_name_2_{page_number}\" size=\"30\" value=\"{main_applicant_name_2}\"/></b></i> this Certificate of Naturalisation, and declares that upon taking the oath or affirmation of allegiance in the manner required by the Act shall be a citizen of Dominica as from the\n                date of this certificate.\n            </p>\n            <p style=\"text-indent: 30px; padding-bottom: 75px; text-align: right;\">In witness whereof I have hereto subscribed my name this ____ day of _________, ______.</p>\n        \n            <table border=\"0\" cellpadding=\"3\" width=\"100%\">\n                <tr>\n                    <td width=\"65%\"></td>\n                    <td width=\"35%\" style=\"font-style: italic; font-size: smaller; text-align: center\">...............................................................................................<br/>MINISTER FOR NATIONAL SECURITY</td>\n                </tr>\n            </table>\n        \n            <p align=\"center\" style=\"font-weight: bold; padding: 40px 0 10px;\">Particulars relating to applicant</p>\n        \n            <table border=\"0\" cellpadding=\"2\" width=\"100%\">\n                <tr>\n                    <td width=\"37%\" rowspan=\"8\" style=\"text-align: center\">{photo}<input type=\"hidden\" name=\"photo_path_{page_number}\" value=\"{photo_path}\"/></td>\n                    <td width=\"30%\" height=\"30px\"><label for=\"main_applicant_name_3_{page_number}\">FULL NAME:</label></td>\n                    <td width=\"33%\" height=\"30px\"><textarea id=\"main_applicant_name_3_{page_number}\" name=\"main_applicant_name_3_{page_number}\" cols=\"37\" rows=\"2\">{main_applicant_name_3}</textarea></td>\n                </tr>\n                <tr>\n                    <td width=\"30%\" height=\"70px\"><label for=\"address_{page_number}\">ADDRESS:</label></td>\n                    <td width=\"33%\" height=\"70px\"><textarea id=\"address_{page_number}\" name=\"address_{page_number}\" cols=\"37\" rows=\"5\">{address}</textarea></td>\n                </tr>\n                <tr>\n                    <td width=\"30%\" height=\"30px\"><label for=\"occupation_{page_number}\">PROFESSION/<br/>OCCUPATION:</label></td>\n                    <td width=\"33%\" height=\"30px\"><textarea id=\"occupation_{page_number}\" name=\"occupation_{page_number}\" cols=\"37\" rows=\"2\">{occupation}</textarea></td>\n                </tr>\n                <tr>\n                    <td width=\"30%\"><label for=\"place_of_birth_{page_number}\">PLACE OF BIRTH:</label></td>\n                    <td width=\"33%\"><input type=\"text\" id=\"place_of_birth_{page_number}\" name=\"place_of_birth_{page_number}\" value=\"{place_of_birth}\" size=\"37\"/></td>\n                </tr>\n                <tr>\n                    <td width=\"30%\"><label for=\"date_of_birth_{page_number}\">DATE OF BIRTH:</label></td>\n                    <td width=\"33%\"><input type=\"text\" id=\"date_of_birth_{page_number}\" name=\"date_of_birth_{page_number}\" value=\"{date_of_birth}\" size=\"37\"/></td>\n                </tr>\n                <tr>\n                    <td width=\"30%\"><label for=\"marital_status_{page_number}\">SINGLE/MARRIED, etc.:</label></td>\n                    <td width=\"33%\"><input type=\"text\" id=\"marital_status_{page_number}\" name=\"marital_status_{page_number}\" value=\"{marital_status}\" size=\"37\"/></td>\n                </tr>\n                <tr>\n                    <td width=\"30%\" height=\"30px\"><label for=\"name_of_spouse_{page_number}\">NAME OF SPOUSE:</label></td>\n                    <td width=\"33%\" height=\"30px\"><textarea id=\"name_of_spouse_{page_number}\" name=\"name_of_spouse_{page_number}\" cols=\"37\" rows=\"2\">{name_of_spouse}</textarea></td>\n                </tr>\n            </table>\n        </div>',
        '2019-11-13'),
       (27, 'system', 'Marketplace Prospect to Client Fee', 'Marketplace prospect to client conversion', 'support@officio.com.au', '', '', 'support@officio.com.au',
        '<table border=\"1\" cellpadding=\"5\" cellspacing=\"0\">\r\n    <tbody>\r\n    <tr>\r\n        <td>BILL TO</td>\r\n    </tr>\r\n    <tr>\r\n        <td>{admin first name} {admin last name}<br>{company name}<br>{company address}<br>{company city} {company province/state} {company postal code/zip}<br>{company country}\r\n        </td>\r\n    </tr>\r\n    </tbody>\r\n</table><br><br><br>\r\n<table border=\"1\" cellpadding=\"5\" cellspacing=\"0\">\r\n    <tbody>\r\n    <tr>\r\n        <td align=\"middle\">INVOICE NO.</td>\r\n        <td align=\"middle\">DATE</td>\r\n        <td align=\"middle\">TERMS</td>\r\n    </tr>\r\n    <tr>\r\n        <td align=\"left\">{invoice: number}</td>\r\n        <td align=\"middle\">{invoice: date}</td>\r\n        <td><br></td>\r\n    </tr>\r\n    </tbody>\r\n</table><br><br>\r\n<table border=\"1\" cellpadding=\"5\" cellspacing=\"0\">\r\n    <tbody>\r\n    <tr>\r\n        <td align=\"middle\" width=\"50%\">DESCRIPTION</td>\r\n        <td align=\"middle\" width=\"20%\">RATE</td>\r\n        <td align=\"middle\" width=\"15%\">QTY</td>\r\n        <td align=\"middle\" width=\"15%\">AMOUNT</td>\r\n    </tr>\r\n    <tr>\r\n        <td width=\"50%\">Fee for the Marketplace prospect lead<br></td>\r\n        <td align=\"middle\" width=\"20%\">${company prospect: conversion rate}</td>\r\n        <td align=\"middle\" width=\"15%\">{company prospect: conversion quantity}</td>\r\n        <td align=\"right\" width=\"15%\">${invoice: subtotal}</td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan=\"3\" width=\"85%\"><br></td>\r\n        <td align=\"right\" width=\"15%\"><b>${invoice: subtotal}</b></td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan=\"4\" width=\"100%\"><br></td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan=\"3\" align=\"left\" width=\"85%\">GST/HST (Registration No. 896191244)</td>\r\n        <td align=\"right\" width=\"15%\">${invoice: gst/hst fee}</td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan=\"4\" width=\"100%\"><br></td>\r\n    </tr>\r\n    <tr>\r\n        <td colspan=\"3\" align=\"right\" width=\"85%\"><b>TOTAL</b></td>\r\n        <td align=\"right\" width=\"15%\"><b>${invoice: total}</b></td>\r\n    </tr>\r\n    </tbody>\r\n</table><br>\r\n<p></p>\r\n<center>\r\n    <b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b>\r\n</center>\r\n<p></p>',
        '2019-11-13'),
       (28, 'system', 'New Company Signup - Started', 'New Company Signup - Started', 'support@officio.ca', 'support@officio.ca', '', '', '<h1>New Company Signup - Started</h1>\n<div>Company name: {prospects: company}</div>\n<div>Company phone (W): {prospects: company}</div>\n<br>\n<h2>Admin User Details</h2>\n<div>First Name: {prospects: admin_first_name}</div>\n<div>Last Name: {prospects: admin_last_name}</div>\n<div>Email: {prospects: admin_email}</div>\n<div>Username: {prospects: admin_username}</div>\n<br>\n<h3>You should receive a second email confirmation after they have successfully paid for the subscription.</h3>', '2022-11-14'),
       (29, 'system', 'New Company Signup - Failed (Payment Successful)', 'New Company Signup - Failed (Payment Successful)', 'support@officio.ca', 'support@officio.ca', '', '', '<h1>New Company Signup - Failed (Payment Successful)</h1>\n<div>Company name: {prospects: company}</div>\n<div>Company phone (W): {prospects: company}</div>\n<br>\n<h2>Admin User Details</h2>\n<div>First Name: {prospects: admin_first_name}</div>\n<div>Last Name: {prospects: admin_last_name}</div>\n<div>Email: {prospects: admin_email}</div>\n<div>Username: {prospects: admin_username}</div>\n<br>\n', '2022-11-14'),
       (30, 'system', 'Officio Daily Notifications', 'Daily Notifications', 'Officio \"no-reply@officio.ca\"', '{user: email}', '', '',
        '<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" lang=\"en-GB\">\n<head>\n    <title>Daily Officio Notifications</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\"/>\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"/>\n\n    <style type=\"text/css\">\n        body {\n            margin: 0;\n            padding: 0;\n            color: #082040;\n        }\n\n        h1 {\n            margin: 0;\n            padding: 0;\n            font-weight: normal;\n        }\n\n        h2 {\n            margin: 0;\n            padding: 0;\n            font-weight: normal;\n        }\n\n        a[x-apple-data-detectors] {\n            color: inherit !important;\n        }\n\n        .today_news_item {\n            border-collapse: collapse;\n            border: 2px solid #E0EDFF;\n            border-radius: 5px;\n            width: 150px;\n        }\n\n        .today_news_item_spacer {\n            width: 15px;\n        }\n\n        .today_news_title {\n            text-align: center;\n            background-color: #E0EDFF;\n            padding: 5px;\n            font-weight: bold;\n        }\n\n        .today_news_count {\n            text-align: center;\n            font-size: 48px;\n        }\n\n        .block_spacer {\n            padding: 10px;\n        }\n    </style>\n\n</head>\n<body>\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"border-collapse: collapse;\">\n    <tr>\n        <td style=\"padding: 20px 0 10px; border-bottom: 2px solid #6793CD;\">\n            <a href=\"https://officio.ca/\"><img alt=\"Officio\" width=\"160\" height=\"41\" src=\"{settings: officio url}/images/default/logo_new.png\"/></a>\n        </td>\n    </tr>\n\n    <tr>\n        <td style=\"padding-top: 20px\">\n            <div>Hello {user: first name}. Happy {today_date_day}!</div>\n            <br>\n            <div>The following is an update for {today_date}:</div>\n        </td>\n    </tr>\n\n    <tr>\n        <td style=\"{studio_news_block_style}\">\n            <div class=\"block_spacer\">&nbsp;</div>\n            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"border-collapse: collapse; {studio_news_block_style}\">\n                <tr>\n                    <td>\n                        <h1>Studio News</h1>\n                    </td>\n                </tr>\n                <tr>\n                    <td>\n                        {studio_news}\n                    </td>\n                </tr>\n            </table>\n        </td>\n    </tr>\n\n    <tr>\n        <td style=\"{announcements_block_style}\">\n            <div class=\"block_spacer\">&nbsp;</div>\n            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"border-collapse: collapse; {announcements_block_style}\">\n                <tr>\n                    <td>\n                        <h1>Announcements</h1>\n                    </td>\n                </tr>\n                <tr>\n                    <td>\n                        {announcements}\n                    </td>\n                </tr>\n            </table>\n        </td>\n    </tr>\n\n    <tr>\n        <td>\n            <div class=\"block_spacer\">&nbsp;</div>\n            <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"border-collapse: collapse;\">\n                <tr>\n                    <td>\n                        <h1>Today\'s Summary</h1>\n                        <h4>New or unread items:</h4>\n                    </td>\n                </tr>\n                <tr>\n                    <td>\n                        {today_news}\n                    </td>\n                </tr>\n            </table>\n        </td>\n    </tr>\n\n    <tr>\n        <td>\n            <div style=\"padding: 20px 0;\">\n                <div style=\"margin-top: 40px;\">For privacy reasons, clients and prospects names are not visible in this email. Please login to your <a href=\"{settings: officio url}\">Officio</a> account for details.</div>\n                <div style=\"margin-top: 20px;\">Wishing you a pleasant day.<br>Team Officio</div>\n            </div>\n        </td>\n    </tr>\n\n    <tr>\n        <td>\n            <div style=\"padding: 20px 0; border-top: 2px solid #E9EAEC;\">\n                <div style=\"color: #808080; font-size: smaller\">To discontinue receiving daily email notifications, go to the Dashboard and toggle off the daily email notification.</div>\n            </div>\n        </td>\n    </tr>\n</table>\n</body>\n</html>',
        '2021-06-24'),
       (31, 'system', 'New 2FA token', 'Officio Verification Code', NULL, '{user: email}', NULL, NULL, '\n                <span style=\"font-style: italic\">This is an automated message from Officio, please do not reply to it. </span><br />\n                <br />\n                Dear {user: name},<br />\n                <br />\n                Here is verification code for your recent login attempt:<br />\n                <br />\n                {2fa_token: guid}<br />\n                <br />\n                Please copy and paste it to the corresponding field in Officio.<br />\n                <br />\n                Regards,<br />\n                Officio Support Team<br />\n            ', '2022-11-14'),
       (32, 'system', 'Login from new device', 'Officio login from new device', NULL, '{user: email}', NULL, NULL,
        '\n                <span style=\"font-style: italic\">This is an automated message from Officio, please do not reply to it. </span><br />\n                <br />\n                Dear {user: name},<br />\n                <br />\n                We have detected a log in attempt from a previously unknonwn device.<br />\n                <br />\n                Details of the login:<br />\n                Location: {trusted_device: location}<br />\n                Browser: {trusted_device: browser}<br />\n                OS: {trusted_device: os}<br />\n                IP Address: {trusted_device: last_login_ip}<br />\n                <br />\n                If that wasn\'t you, we strongly suggest to change your password and contact us if it happens again.<br />\n                If that was your device, no further action needed.<br />\n                <br />\n                Regards,<br />\n                Officio Support Team<br />\n            ', '2022-11-14');
