    `handler_class`  varchar(1024) NOT NULL,
    `info`           blob,
    `failed`         int           NOT NULL DEFAULT '0',
    `failure_log`    blob,
    PRIMARY KEY (`id`),
    KEY `created` (`created`),
    KEY `priority` (`priority`),
    KEY `failed` (`failed`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb3;
