INSERT INTO `templates`
VALUES (9287, 1, 1, 7174, 0, 'General', 'Email', 'Default Template', 'RE: Email Received', '', '', '', '<font face=\"tahoma, arial, helvetica, sans-serif\" size=\"2\">Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;</font><br><br><font face=\"tahoma, arial, helvetica, sans-serif\" size=\"2\">\nThank you for your email, we endeavour&nbsp;</font><font face=\"tahoma, arial, helvetica, sans-serif\" size=\"2\">to reply as soon as possible.</font><br><br><br><br><font face=\"tahoma, arial, helvetica, sans-serif\" size=\"2\">\nRegards,</font><br><font face=\"tahoma, arial, helvetica, sans-serif\" size=\"2\">\n&lt;%current_user_email_signature%&gt;</font>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'Y', 0),
       (9290, 1, 1, 7174, 118, 'Welcome', 'Email', 'Welcome', 'Re: Welcome', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<div><br><p>I would like to welcome you to &lt;%company_name%&gt;.</p><p>Please note that your client ID is: &lt;%file_number%&gt;. Please use this reference number in all communications with us.</p><p>We are thrilled to have you as our client and are looking forwards to working with you. Your &lt;%visa_subclass%&gt; matter will be handled by &lt;%registered_migrant_agent%&gt; and &lt;%processing%&gt;.</p><p>You will receive further communications from us very soon. Meanwhile, please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt; if you have any questions.</p><p>Once again, thank you for choosing our services.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p></p></div>', '2014-06-05 00:00:00', '2014-06-05 00:00:00', 'N', 0),
       (9371, 906, 906, 7210, 119, 'General', 'Email', 'Default Template', 'RE: Email Received', '', '', '', '<div>Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<br />\n<br />\nThank you for your email, we endeavour&nbsp;to reply as soon as possible.<br />\n<br />\n<br />\n<br />\nRegards,<br />\n&lt;%current_user_email_signature%&gt;</div>', '2015-06-23 00:00:00', '2015-06-23 00:00:00', 'Y', 0),
       (9372, 906, 906, 7210, 118, 'Welcome', 'Email', 'Welcome', 'Re: Welcome', '', '', '', 'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<div><br><p>I would like to welcome you to &lt;%company_name%&gt;.</p><p>Please note that your client ID is: &lt;%file_number%&gt;. Please use this reference number in all communications with us.</p><p>We are thrilled to have you as our client and are looking forwards to working with you. Your &lt;%visa_subclass%&gt; matter will be handled by &lt;%registered_migrant_agent%&gt; and &lt;%processing%&gt;.</p><p>You will receive further communications from us very soon. Meanwhile, please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt; if you have any questions.</p><p>Once again, thank you for choosing our services.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p></p></div>', '2015-06-23 00:00:00', '2015-06-23 00:00:00', 'N', 0),
       (9373, 906, 906, 7210, 130, 'Welcome', 'Email', 'SI AOR', 'BC PNP Acknowledgement of Receipt', 'The BC PNP notification \"noreply@gov.bc.ca\"', '', '',
        '<div>\n<div>&nbsp;</div>\n\n<div>\n<div style=\"text-align:center\">\n<table align=\"center\" border=\"0\" cellpadding=\"10\" cellspacing=\"1\" style=\"border-collapse:collapse; font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px; line-height:20.7999992370605px; width:650px\">\n	<tbody>\n		<tr>\n			<td>\n			<div style=\"text-align:left\">\n			<div><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Date:&nbsp;&lt;%today_date%&gt;</span></span></div>\n\n			<div>&nbsp;</div>\n\n			<div><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Dear&nbsp;&lt;%first_name%&gt;&nbsp;&lt;%last_name%&gt;:</span></span></div>\n\n			<div>&nbsp;</div>\n\n			<div><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">This email confirms that your submission to the British&nbsp;Columbia Provincial Nominee Program (BC PNP) for&nbsp;</span></span></span><strong><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:10.0pt\">&lt;%first_name%&gt;&nbsp;&lt;%last_name%&gt;</span></span></span></strong>&nbsp;<span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">was received on&nbsp;<strong>&lt;%date_client_signed%&gt;</strong>.</span></span></span></div>\n\n			<div>&nbsp;</div>\n\n			<div><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Your BC PNP file number is:&nbsp;<strong>&lt;%file_number%&gt;</strong></span></span></div>\n\n			<div>&nbsp;</div>\n\n			<div><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">Your application will be reviewed according to the BC PNP criteria and processing times in place at the time of submission.&nbsp;<strong>Please be advised that processing does not guarantee approval.</strong></span></span></span></div>\n\n			<div><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>PLEASE NOTE:</strong></span></span></div>\n\n			<ul>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">You are responsible for maintaining your legal immigration status while in Canada. Please visit CIC&rsquo;s website for more information:&nbsp;<a href=\"http://www.cic.gc.ca/\"><span style=\"color:#0782C1\">www.cic.gc.ca</span></a></span></span></li>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">You must ensure that your contact information in your&nbsp;<a href=\"https://www.pnpapplication.gov.bc.ca/\"><span style=\"color:#0782C1\">BC PNP Online profile</span></a>&nbsp;is up-to-date.</span></span></li>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">You can check the status of your application at any time by logging in to see&nbsp;<a href=\"https://www.pnpapplication.gov.bc.ca/\"><span style=\"color:#0782C1\">your profile dashboard</span></a>. The dashboard has the most up to date information about your individual file status.</span></span></li>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">The BC PNP will never ask for credit card or other payment information via email. Payments to the the PNP are only accepted through the PNP Online secure system.</span></span></li>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">The information you have provided in your online submission is secure and email communications are not. Always ensure that you are communicating directly with a PNP advisor when personal or sensitive information is involved.</span></span></li>\n			</ul>\n\n			<div>&nbsp;</div>\n\n			<div><strong><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">Please be aware that our processing times are impacted by the volume of applications received and the program&rsquo;s processing capacity. For the most current information about processing times, please check the website:&nbsp;<a href=\"http://www.welcomebc.ca/Immigrate/About-the-BC-PNP/About-the-BC-PNP/Processing-Times.aspx\"><span style=\"color:#0782C1\">http://www.welcomebc.ca/Immigrate/About-the-BC-PNP/About-the-BC-PNP/Processing-Times.aspx</span></a></span></span></span></strong></div>\n\n			<div>&nbsp;</div>\n\n			<div><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">For information about what happens after you submit an application, please visit this page of the website:&nbsp;<a href=\"http://www.welcomebc.ca/Immigrate/About-the-BC-PNP/Skills-Immigration/How-To-Apply.aspx\"><span style=\"color:#0782C1\">http://www.welcomebc.ca/Immigrate/About-the-BC-PNP/Skills-Immigration/How-To-Apply.aspx</span></a></span></span></span></div>\n\n			<div>&nbsp;</div>\n\n			<div>\n			<div><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\"><a href=\"http://www.welcomebc.ca/Immigrate/About-the-BC-PNP.aspx\"><strong><em><span style=\"color:#0782C1\">BC Provincial Nominee Program</span></em></strong></a><br />\n			Economic Immigration Programs Branch</span></span></span></div>\n			<span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">Ministry of Jobs, Tourism and Skills Training</span></span></span></div>\n			</div>\n			</td>\n		</tr>\n	</tbody>\n</table>\n</div>\n</div>\n</div>',
        '2015-06-26 00:00:00', '2015-06-26 00:00:00', 'N', 0),
       (9374, 906, 906, 7210, 131, 'Welcome', 'Email', 'EI AOR', 'BC PNP Acknowledgement of Receipt', 'The BC PNP notification \"noreply@gov.bc.ca\"', '', '',
        '<div>\n<div>&nbsp;</div>\n\n<div>\n<div style=\"text-align:center\">\n<table align=\"center\" border=\"0\" cellpadding=\"10\" cellspacing=\"1\" style=\"border-collapse:collapse; font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px; line-height:20.7999992370605px; width:650px\">\n	<tbody>\n		<tr>\n			<td>\n			<div style=\"text-align:left\">\n			<div><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Date:&nbsp;&lt;%today_date%&gt;</span></span></div>\n\n			<div>&nbsp;</div>\n\n			<div><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Dear&nbsp;&lt;%first_name%&gt;&nbsp;&lt;%last_name%&gt;:</span></span></div>\n\n			<div>&nbsp;</div>\n\n			<div>\n			<div><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">This email confirms that your submission to the British&nbsp;Columbia Provincial Nominee Program (BC PNP) for&nbsp;<strong>&lt;%first_name%&gt;&nbsp;&lt;%last_name%&gt;</strong></span></span></span>&nbsp;<span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">was received on&nbsp;<strong>&lt;%date_client_signed%&gt;</strong>.</span></span></span></div>\n			<span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">Your registration will be reviewed according to the BC PNP criteria and processing times in place at the time of submission.&nbsp;<strong>Please be advised that review does not guarantee entry into the eligibility pool.</strong></span></span></span>\n\n			<div>&nbsp;</div>\n\n			<div><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">You will be notified on whether your registration will be selected into the eligibility pool.</span></span></span></div>\n\n			<div>&nbsp;</div>\n\n			<div><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>PLEASE NOTE:</strong></span></span></div>\n\n			<ul>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">You are responsible for maintaining your legal immigration status while in Canada. Please visit Citizenship and Immigration Canada&rsquo;s website for more information:&nbsp;<a href=\"http://www.cic.gc.ca/\"><span style=\"color:#0782C1\">www.cic.gc.ca</span></a></span></span></li>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">You must ensure that your contact information in your&nbsp;<a href=\"https://www.pnpapplication.gov.bc.ca/\"><span style=\"color:#0782C1\">BC PNP Online profile</span></a>&nbsp;is up-to-date.</span></span></li>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">You can check the status of your registration at any time by logging in to see&nbsp;<a href=\"https://www.pnpapplication.gov.bc.ca/\"><span style=\"color:#0782C1\">your profile dashboard</span></a>. The dashboard has the most up-to-date information about your registration status.</span></span></li>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">The BC PNP will never ask for credit card or other payment information via email. Payments to the PNP are only accepted through the BC PNP Online secure system.</span></span></li>\n				<li><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">The information you have provided in your online submission is secure and email communications are not. Always ensure that you are communicating directly with the BC PNP when personal or sensitive information is involved.</span></span></li>\n			</ul>\n\n			<div>&nbsp;</div>\n\n			<div>\n			<div><span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\"><a href=\"http://www.welcomebc.ca/Immigrate/About-the-BC-PNP.aspx\"><strong><em><span style=\"color:#0782C1\">BC Provincial Nominee Program</span></em></strong></a><br />\n			Economic Immigration Programs Branch</span></span></span></div>\n			<span style=\"color:#333333\"><span style=\"font-family:arial,sans-serif\"><span style=\"font-size:9.0pt\">Ministry of Jobs, Tourism and Skills Training</span></span></span></div>\n			</div>\n			</div>\n			</td>\n		</tr>\n	</tbody>\n</table>\n</div>\n</div>\n</div>',
        '2015-06-26 00:00:00', '2015-06-26 00:00:00', 'N', 0),
       (9375, 906, 906, 7210, 200, 'Welcome', 'Email', 'SI Registration AOR', 'SIRS Confirmation of Registration', 'The BC PNP notification \"noreply@gov.bc.ca\"', '', '',
        '<div> <div> <p>&nbsp;</p>  <div> <div style=\"text-align:center\"> <table align=\"center\" border=\"0\" cellpadding=\"10\" cellspacing=\"1\" style=\"border-collapse:collapse; font-family:sans-serif,arial,verdana,trebuchet ms; font-size:13px; line-height:20.7999992370605px; width:650px\"> 	<tbody> 		<tr> 			<td> 			<div style=\"text-align:left\"> 			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Date:&nbsp;&lt;%today_date%&gt;</span></span></p>  			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Dear&nbsp;&lt;%first_name%&gt;&nbsp;&lt;%last_name%&gt;:</span></span></p>  			<div> 			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">This email confirms your registration to the British&nbsp;Columbia Provincial Nominee Program (BC PNP) for&nbsp;<strong>&lt;%first_name%&gt;&nbsp;&lt;%last_name%&gt; </strong>in the &lt;%siCategoryName%&gt; category.</span></span></p>  			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Your BC PNP file number is:&nbsp;<strong>&lt;%file_number%&gt;</strong></span></span></p>  			<div> 			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Your registration was received on <span style=\"color:rgb(51, 51, 51)\"><strong>&lt;%date_client_signed%&gt;</strong></span> and will expire on <span style=\"color:rgb(51, 51, 51)\"><strong>&lt;%sirsExpiryDate%&gt;</strong></span>.</span></span></p> 			</div> 			</div>  			<div> 			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Important information:</span></span></p>  			<ul> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">A registration into the Skills Immigration Registration System is not an application to the BC PNP or a guarantee that you will be invited to apply.</span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">You may only have one active registration at a time.</span></span></span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Your registration is valid only for the category that you have selected. </span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">The frequency and number of invitations issued will be determined by the BC PNP&rsquo;s processing capacity and is subject to change. </span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Your registration was scored according to the factors applicable at the time of submission. </span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Should you be invited to apply, your application may be refused if the information in your application is different from what you submitted in your registration.</span></span></li> 			</ul>  			<p>&nbsp;</p> 			</div>  			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>PLEASE NOTE:</strong></span></span></p>  			<ul> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">You are responsible for maintaining your legal immigration status while in Canada. Please visit Immigration, Refugee and Citizenship Canada&rsquo;s (IRCC)&rsquo;s website for more information:&nbsp;<a href=\"http://www.cic.gc.ca/\"><span style=\"color:rgb(7, 130, 193)\">www.cic.gc.ca</span></a></span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">You must ensure that your contact information in your&nbsp;<a href=\"https://www.pnpapplication.gov.bc.ca/\"><span style=\"color:rgb(7, 130, 193)\">BC PNP Online profile</span></a>&nbsp;is up-to-date.</span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">If you wish to change the information that you have entered in your registration, you must withdraw your registration and submit a new registration with the updated information. You may withdraw and/or submit registrations using your existing BC PNP Online profile. </span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">You can check the status of your registration at any time by checking your BC PNP Online <a href=\"https://www.pnpapplication.gov.bc.ca/\">profile dashboard</a>. The dashboard has the most up to date information about your individual file status.</span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">The BC PNP will never ask for credit card or other payment information via email. Payments to the the PNP are only accepted through the PNP Online secure system.</span></span></li> 				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">The information you have provided in your online submission is secure, and email communications may not be. Please use caution when communicating personal or sensitive information via email.</span></span></li> 			</ul>  			<div> 			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">For information on the BC PNP process, including invitations to apply, the date, number of invitations issued and the required minimum score, please visit the <a href=\"http://www.welcomebc.ca/pnp\">BC PNP website</a>. </span></span><br /> 			&nbsp;</p> 			</div>  			<div> 			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:rgb(51, 51, 51)\"><a href=\"http://www.welcomebc.ca/Immigrate/About-the-BC-PNP.aspx\"><strong><em><span style=\"color:rgb(7, 130, 193)\">BC Provincial Nominee Program</span></em></strong></a><br /> 			Economic Immigration Programs Branch<br /> 			Ministry of Jobs, Tourism and Skills Training</span></span></span></p> 			</div> 			</div> 			</td> 		</tr> 		<tr> 			<td> 			<p>&nbsp;</p> 			</td> 		</tr> 	</tbody> </table> </div> </div> </div> </div>',
