antee that you will be invited to apply.</span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">You may only have one active registration at a time.</span></span></span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Your registration is valid only for the category that you have selected. </span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">The frequency and number of invitations issued will be determined by the BC PNP&rsquo;s processing capacity and is subject to change. </span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Your registration was scored according to the factors applicable at the time of submission. </span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">Should you be invited to apply, your application may be refused if the information in your application is different from what you submitted in your registration.</span></span></li>\r\n			</ul>\r\n\r\n			<p>&nbsp;</p>\r\n			</div>\r\n\r\n			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>PLEASE NOTE:</strong></span></span></p>\r\n\r\n			<ul>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">You are responsible for maintaining your legal immigration status while in Canada. Please visit Immigration, Refugee and Citizenship Canada&rsquo;s (IRCC)&rsquo;s website for more information:&nbsp;<a href=\"http://www.cic.gc.ca/\"><span style=\"color:rgb(7, 130, 193)\">www.cic.gc.ca</span></a></span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">You must ensure that your contact information in your&nbsp;<a href=\"https://www.pnpapplication.gov.bc.ca/\"><span style=\"color:rgb(7, 130, 193)\">BC PNP Online profile</span></a>&nbsp;is up-to-date.</span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">If you wish to change the information that you have entered in your registration, you must withdraw your registration and submit a new registration with the updated information. You may withdraw and/or submit registrations using your existing BC PNP Online profile. </span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">You can check the status of your registration at any time by checking your BC PNP Online <a href=\"https://www.pnpapplication.gov.bc.ca/\">profile dashboard</a>. The dashboard has the most up to date information about your individual file status.</span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">The BC PNP will never ask for credit card or other payment information via email. Payments to the the PNP are only accepted through the PNP Online secure system.</span></span></li>\r\n				<li><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">The information you have provided in your online submission is secure, and email communications may not be. Please use caution when communicating personal or sensitive information via email.</span></span></li>\r\n			</ul>\r\n\r\n			<div>\r\n			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\">For information on the BC PNP process, including invitations to apply, the date, number of invitations issued and the required minimum score, please visit the <a href=\"http://www.welcomebc.ca/pnp\">BC PNP website</a>. </span></span><br />\r\n			&nbsp;</p>\r\n			</div>\r\n\r\n			<div>\r\n			<p><span style=\"font-size:12px\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"color:rgb(51, 51, 51)\"><a href=\"http://www.welcomebc.ca/Immigrate/About-the-BC-PNP.aspx\"><strong><em><span style=\"color:rgb(7, 130, 193)\">BC Provincial Nominee Program</span></em></strong></a><br />\r\n			Economic Immigration Programs Branch<br />\r\n			Ministry of Jobs, Tourism and Skills Training</span></span></span></p>\r\n			</div>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',
