(
    `ticket_id`         int unsigned                           NOT NULL AUTO_INCREMENT,
    `company_id`        bigint                                          DEFAULT NULL,
    `company_member_id` bigint                                          DEFAULT NULL,
    `author_id`         bigint                                          DEFAULT NULL,
    `ticket`            text,
    `contacted_by`      enum ('phone','email','chat','system') NOT NULL DEFAULT 'phone',
    `status`            enum ('resolved','not_resolved')       NOT NULL DEFAULT 'not_resolved',
    `create_date`       datetime                                        DEFAULT NULL,
    PRIMARY KEY (`ticket_id`),
    KEY `FK_tickets_author` (`author_id`),
    KEY `FK_tickets_company_member` (`company_member_id`),
    KEY `FK_tickets_company` (`company_id`),
    CONSTRAINT `FK_tickets_author` FOREIGN KEY (`author_id`) REFERENCES `members` (`member_id`) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT `FK_tickets_company` FOREIGN KEY (`company_id`) REFERENCES `company` (`company_id`) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT `FK_tickets_company_member` FOREIGN KEY (`company_member_id`) REFERENCES `members` (`member_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb3;
